	add("anna", "{\"term\":\"anna\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hebrew\"], \"text\":\"The Latinate and New Testament form of Ann, from \u0027ἄννα\u0027 (sc\u003dpolytonic) equal to the Hebrew female name \u0027חנה\u0027 (hannah) of Old Testament, meaning \u0026quot;grace, gracious\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1886\u0027\u0027 w:William Ernest William Ernest Henley, \u0027A Ballade of Ladies\u0027 Names\u0027, Gleeson White:Ballades and Rondeaus, Read Books 1887, page 19\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Every lover the years disclose / Is of a beautiful name made free. / One befriends, and all others are foes. / \u0027\u0027Anna\u0027\u0027s the name of names for me\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027 w:Sue Sue Miller, \u0027The Good Mother\u0027, G.K.Hall 1987, ISBN 081614169X, page 183\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"His real name was Leonard, Len. He\u0027d changed it when he came East. \u0026quot;Len,\u0026quot; he said. \u0026quot;A turd of a name. Who wants it? I mean a name that ends in a nasalization, for Christ\u0027s sake. Leo now. It\u0027s like \u0027\u0027Anna\u0027\u0027. They go on forever. You can live with a name like that.\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A prophetess in the New Testament\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"And there was one \u0027\u0027Anna\u0027\u0027, a prophetess, the daughter of Phanuel, of the tribe of Aser: she was of great age, and had lived with an husband seven years from her virginity\", \"priority\":6}]}, \"synonyms\":{}}");

